import React from 'react';
import './panCss.css';
import {connect} from 'react-redux';
import {allActions} from '../../_actions'
import GridLayout from 'react-grid-layout';

class planPrint extends React.Component {
   constructor() {
      super();
      this.state = {
         colors: "green",
         hover: false,
      }
   }
   render() {
    // layout is an array of objects, see the demo for more complete usage
    return (
        <Grid className="divCss">
            <Grid className="" size={3}>11</Grid>
            <Grid className="" size={3}>112</Grid>
            <Grid className="" size={3}>113</Grid>
            <Grid className="" size={3}>114</Grid>

            <Grid className="" size={3}>115</Grid>
            <Grid className="" size={3}>1176</Grid>
            <Grid className="" size={3}>117</Grid>
            <Grid className="" size={3}>118</Grid>


        </Grid>
    )
  }

}


export default connect(allActions.mapStateToProps,allActions.mapDispatchToProps)(planPrint);
